import React from 'react'
import { View, Text, TouchableOpacity } from 'react-native'

export default function OrderScreen({ navigation }) {
    return (
        <View>
            <Text>Order</Text>
            <TouchableOpacity onPress={() => navigation.goBack('Home')}>
                <Text>move</Text>
            </TouchableOpacity>
        </View>
    )
}
